import './App.css';
import Alert from 'react-bootstrap/Alert';



function App() {
  return (
    <div className="App">
      <>
      {[
        'primary',
        'secondary',
        'success',
        'danger',
        'warning',
        'info',
        'light',
        'dark',
      ].map((variant) => (
        <Alert key={variant} variant={variant}>
          This is a {variant} alert with{' '}
          <Alert.Link href="https://www.google.com">google</Alert.Link>. Give it a click if
          you like.
        </Alert>
      ))}
    </>

    </div>
  );
}

export default App;
